import React from 'react';
import TagButton from './TagButton'

import $ from 'jquery'

class TagContainer extends React.Component {

    constructor(props){
        super(props);
        this.state = {
			tags: [],
		}
    }

	render(){
		return(
            <div>
                ({this.props.tags}) => {
                    $.each(tags, function() {
                        <TagButton value={this.name}/>
                    })
                }
            </div>
        
		);
	}
}

export default TagContainer
